import React, { Component } from "react";
import {
  getEvents,
  fetchEventsbyDate,
  fetchEventsbyNames
} from "../services/eventService";

class Home extends Component {
  state = {
    publicEvents: []
  };

  async componentDidMount() {
    const data = await getEvents();
    console.log(data);

    //this.setState({ publicEvents });
  }

  render() {
    return (
      <div>
        <div className="row">"test"</div>
      </div>
    );
  }
}
export default Home;
